import React, { useState } from "react";
import NavBar from "../common/NavBar";
import NewHeader from "./NewHeader";

import { useForm } from "react-hook-form";
import PopUp from "../pages/PopUp";
import Swal from "sweetalert2";

export default function MainLayout() {
  let [firstname, setfirstname] = useState("");
  let [lastname, setlastname] = useState("");
  let [email, setemail] = useState("");
  let [phone, setphone] = useState("");
  let [Location, setLocation] = useState("");
  let [DateOfBirth, setDateOfBirth] = useState("");
  let [clientType, setClientType] = useState("");
  let [isOpen, setIsOpen] = useState(false);

  const togglePopup = () => {
    setIsOpen(!isOpen);
  };

  const {
    register,
    handleSubmit,
    formState: { errors },
  } = useForm();

  const onSubmit = (data, e) => {
    console.log(data);
    setIsOpen(!isOpen);
    Swal.fire("Thank You!", "Your Submission Has Been Received!", "success");
    e.preventDefault();
    console.log("refresh prevented");
  };

  // const collectdata = async () => {
  //   if (
  //     !firstname ||
  //     !lastname ||
  //     !email ||
  //     !phone ||
  //     !Location ||
  //     !DateOfBirth
  //   )}
  //   console.log(firstname, lastname, email, phone, Location, DateOfBirth);
  // let info = await fetch("http://localhost:9000", {
  //   method: "post",
  //   body: JSON.stringify({
  //     firstname,
  //     lastname,
  //     email,
  //     phone,
  //     Location,
  //     DateOfBirth,
  //     clientType,
  //   }),
  //   headers: {
  //     "Content-Type": "application/json",
  //   },
  // });
  // info = await info.json();

  const handleClient = (e) => {
    const { name, value } = e.target;
    alert("okk");

    setClientType({ ...value });
  };

  return (
    <div>
      <div style={{}}>
        <div style={{ display: "flex" }}>
          <div style={{ width: "100%" }}>
            <div
              className="container "
              style={{ display: "flex", width: "100%" }}
            >
              <div style={{ width: "100%" }}>
                <div
                  className="rounded border-gray-300  dark:border-gray-700"
                  style={{ width: "100%" }}
                >
                  <NewHeader />
                  <NavBar />
                </div>

                <div
                  style={{
                    top: "26%",
                    position: "absolute",
                    top: "20%",
                    right: "20%",
                    width: "55%",
                  }}
                >
                  <div className="w-full bg-white p-10">
                    <div className="md:flex items-center border-b border-gray-200">
                      <div className="flex items-center md:mt-0 mt-4"></div>
                    </div>
                    {/* <form onSubmit={onSubmit}> */}
                    <div className="mt-8 md:flex items-center">
                      <div className="flex w-full flex-col">
                        <label
                          for="fname"
                          className="mb-3 text-sm leading-none text-gray-800"
                        >
                          First name
                        </label>
                        <input
                          type="name"
                          tabIndex={0}
                          aria-label="Enter first name"
                          className="w-full bg-gray-100 text-sm font-medium leading-none text-gray-800 p-3 border rounded border-gray-200"
                          defaultValue="William"
                          {...register("fname", {
                            required: "FirstName is required",
                          })}
                        />
                      </div>
                      <div className="flex w-full flex-col md:ml-12 md:mt-0 mt-8">
                        <label
                          for="lname"
                          className="mb-3 text-sm leading-none text-gray-800"
                        >
                          Last name
                        </label>
                        <input
                          name="lname"
                          id="lname"
                          required
                          type="name"
                          tabIndex={0}
                          aria-label="Enter last name"
                          className="w-full bg-gray-100 text-sm font-medium leading-none text-gray-800 p-3 border rounded border-gray-200"
                          defaultValue="Smith"
                          {...register("lname", {
                            required: "LastName is required",
                          })}
                        />
                      </div>
                    </div>
                    <div className="mt-12 md:flex items-center">
                      <div className="flex w-full flex-col">
                        <label
                          for="email"
                          className="mb-3 text-sm leading-none text-gray-800"
                        >
                          Email Address
                        </label>
                        <input
                          name="email"
                          id="email"
                          required
                          type="email"
                          tabIndex={0}
                          aria-label="Enter email Address"
                          className="w-full bg-gray-100 text-sm font-medium leading-none text-gray-800 p-3 border rounded border-gray-200"
                          defaultValue="smith.william@gmail.com"
                          {...register("email", {
                            required: "Email is required",
                          })}
                        />
                      </div>
                      <div className="flex w-full flex-col md:ml-12 md:mt-0 mt-8">
                        <label
                          for="phone"
                          className="mb-3 text-sm leading-none text-gray-800"
                        >
                          Phone number
                        </label>
                        <input
                          name="phone"
                          id="phone"
                          required
                          type="number"
                          tabIndex={0}
                          aria-label="Enter phone number"
                          className="w-full bg-gray-100 text-sm font-medium leading-none text-gray-800 p-3 border rounded border-gray-200"
                          defaultValue="+81 839274"
                          {...register("phone", {
                            required: "phone is required",
                          })}
                        />
                      </div>
                    </div>
                    <div className="mt-12 md:flex items-center">
                      <div className="flex w-full flex-col">
                        <label
                          for="dateofbirth"
                          className="mb-3 text-sm leading-none text-gray-800"
                        >
                          Date of Joining
                        </label>
                        <input
                          name="dateofbirth"
                          id="dateofbirth"
                          required
                          type="date"
                          tabIndex={0}
                          aria-label="Enter date of birth"
                          className="w-full bg-gray-100 text-sm font-medium leading-none text-gray-800 p-3 border rounded border-gray-200"
                          defaultValue="28.03.1997"
                          {...register("dateofbirth", {
                            required: "Date-Of-birth is required",
                          })}
                        />
                      </div>
                      <div className="flex w-full flex-col md:ml-12 md:mt-0 mt-8">
                        <label
                          for="location"
                          className="mb-3 text-sm leading-none text-gray-800"
                        >
                          Location
                        </label>
                        <input
                          name="location"
                          id="location"
                          required
                          type="name"
                          tabIndex={0}
                          aria-label="Enter place of birth"
                          className="w-full bg-gray-100 text-sm font-medium leading-none text-gray-800 p-3 border rounded border-gray-200"
                          defaultValue="San Diego, CA, USA"
                          {...register("location", {
                            required: "location is required",
                          })}
                        />
                      </div>
                    </div>

                    <div className="mt-12 md:flex items-center">
                      <div className="flex w-1/2 flex-col">
                        <form>
                          <p>Client Type</p>
                          <div>
                            <input
                              type="radio"
                              value="  Individual"
                              // checked={clientType === "  Individual"}
                            />
                            Individual
                          </div>
